  input: TEXT,F3XA,,"In response to the Commission's preliminary review of the Year
    End Report 06, corrections have been made to derive correct Column B totals on
    the report.  Monthly reports were filed as required and amendments filed for periods
    before the monthly reports were due that were filed after the monthly report threw
    the year to date numbers off in subsequent reports.  This is also true of the
    ending balance discrepancies.  Once the amendments were filed subsequently, the
    numbers corrected themselves.  Transfers in from the non-federal account on Line
    18 Column B for year end equal 225,022.83.  Line 21a ii Column B discloses 239,332.54
    as the non-federal share for allocated activity year to date.  The difference
    between the two lines is 14,309.71.  On 1/31/07, 13,107.55 was transferred in
    for allocated activity in December 2006.  This transfer was made within the 60
    days allowable after the payment to the vendor.  CC Luncheon events/activities
    are intended to represent one activity.  Action has been taken to correct the
    event year to date totals for administrative and specific fundraising events.  Other
    corrective actions requested have been clarified in the text memo section under
    the corrected entry. "
